import React, { useState, useEffect } from "react";


const Resume = () => {
  const [resume, setResume] = useState([]);


  useEffect(() => {
    async function fetchData() {
      const res = await fetch("http://localhost:3008/resume");
      res.json().then((res) => setResume(res));
      //.catch((err) => setErrors(err));
    }
    fetchData();
  }, [resume]);

  console.log(resume)

    return (

      <article>

<h2>
<ul className="name">
        <div id="resume">
            {resume[0].personal_info.map((item, key) => (
                <li key={item.id} style={{ listStyle: "none" }}>
                {item.name}
                </li>
            ))}
        </div>
</ul>


</h2>
<ul className="personal_info">
        <div id="resume">
            {resume.map((item, key) => (
                <li key={item.id} style={{ listStyle: "none" }}>
                Phone: {item.phone}; Email: {item.email}; Address: {item.street_address}, {item.city}, {item.province}, {item.country}
                </li>
            ))}
        </div>
</ul>
<h3>HIGHLITES OF QUALIFICATIONS:</h3>
<ul className="skills">
        <div id="resume">
            {resume.map((item, key) => (
                <li key={item.id} style={{ listStyle: "none" }}>
                Phone: {item.skill}
                </li>
            ))}
        </div>
</ul>



</article>
    );
  }


export default Resume;
